import React, {Component,createContext} from 'react'
import './../css/item.css'
import { CaretLeft,CaretRight} from '@phosphor-icons/react'
import { Outlet } from 'react-router-dom'
import { Userprovider } from './CartContext'

export const itcont = createContext()

class Item extends Component {
    constructor(props) {
        super(props)
        this.state = {
            qty:0
        }}

        changeimg = (e)=>{
            document.querySelector('.main').src = e.target.src
        }

        actt = (e)=>{
            if(document.querySelector('.acitve')){
            document.querySelector('.acitve').classList.remove('acitve');
            e.target.classList.add('acitve')
        }else{}}

        increment = ()=>{
            this.setState(prev=>{
                return({qty:prev.qty + 1})
            })
        }

        decrement = ()=>{
            this.setState(prev=>{
                return({qty:prev.qty -1})
            })
        }

    render() {

        const qty = this.state.qty

        return (
            <Userprovider value='0' username='mohamed'>
                <div className='item'>
                <div className='item-content'>
                    <div className='left'>
                        <img src='https://api.yeshtery.com/v1/yeshtery/files/31/he4717-12.jpg?height=568' className='main' />
                        <div className='secondary'>
                            <CaretLeft size={32} weight="bold" />
                            <img src='https://api.yeshtery.com/v1/yeshtery/files/31/he4717-2-apparel-photography-front-center-view-white-e40c4cdc4aa147e4be6303263073b682.jpg?height=568' onClick={this.changeimg} />
                            <img src='https://api.yeshtery.com/v1/yeshtery/files/31/he4717-5-apparel-on-model-back-view-white-843ffd3426b64fe2af1fe3ffc040982b.jpg?height=568' onClick={this.changeimg} />
                            <img src='https://api.yeshtery.com/v1/yeshtery/files/31/he4717-6-apparel-on-model-side-view-white-88d9d5bb8d3a46c8806df987a04219fe.jpg?height=568' onClick={this.changeimg} />
                            <CaretRight size={32} weight="bold" />
                        </div>
                    </div>
                    <div className='right'>
                        <div className='title'>
                            <img src='https://api.yeshtery.com/v1/yeshtery/files/31/adidas-2805b77d93b649829a95d869558736a2.png?height=150' />
                            <h3>Adidas black t-shirt lorem ipsum dolor sit amet, consectetuer adipiscing elit</h3>
                            <p>Men</p>
                        </div>
                        <div className='rating'>
                            <p>No Rating Yet</p>
                        </div>
                        <div className='price'>
                            <p>9,999 <sub>LE</sub></p>
                            <del>9,999 LE</del>
                            <p>30% off</p>
                        </div>
                        <div className='size'>
                            <h2>Size</h2>
                            <div>
                                <p className='acitve' onClick={this.actt}>Small</p>
                                <p onClick={this.actt}>Medium</p>
                                <p onClick={this.actt}>Large</p>
                                <p onClick={this.actt}>X Large</p>
                                <p onClick={this.actt}>XX Large</p>
                            </div>
                        </div>
                        <div className='quantity'> 
                            <h2>Quantity</h2>
                            <div>
                                <p onClick={this.decrement}> - </p>
                                <p>{qty}</p>
                                <p onClick={this.increment}> + </p>
                            </div>
                        </div>
                        <div className='addto'>
                            <button>Add To Cart</button>
                            <button>Pickup From Store</button>
                        </div>
                    </div>
                </div>
                <Outlet />

            </div>
            </Userprovider>
 
        )}}

export default Item
